INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("ぺコリーヌ", 40001, 150, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 37, 0, 1, 8, 1, 107501, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("コッコロ", 40001, 150, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 38, 0, 2, 8, 1, 107601, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("キャル", 40001, 150, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 39, 0, 3, 8, 1, 107801, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("スズメ", 40001, 150, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40, 0, 4, 8, 1, 107701, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("タマキ", 40001, 150, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 41, 0, 5, 8, 1, 107901, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("ぺコリーヌ", 40001, 150, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 42, 0, 6, 8, 2, 107501, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("コッコロ", 40001, 150, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 43, 0, 7, 8, 2, 107601, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("キャル", 40001, 150, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 44, 0, 8, 8, 2, 107801, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("スズメ", 40001, 150, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 45, 0, 9, 8, 2, 107701, 91002);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("タマキ", 40001, 150, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 46, 0, 10, 8, 2, 107901, 91002);
